import React, { useEffect, useState } from 'react';
import Chat from './Chat/Chat';
import Form from './Form/Form';

function App() {
  // Сделать роутинг. Сначала забрасывает на страницу где вводят данные, а потом роутинг на сам чат,
  // который уже использует данные из пропса

  const [idInstance, setIdInstance] = useState<string>('')
  const [apiTokenInstance, setApiTokenInstance] = useState<string>('')
  const [friendNumber, setFriendNumber] = useState<string>('')
  const [isButtonClicked, setIsButtonClicked] = useState<boolean>(false)

  return (
    <>
      {isButtonClicked 
      ? <Chat
      ></Chat> 
      : <Form
        idInstance={idInstance}
        setIdInstance={setIdInstance}
        apiTokenInstance={apiTokenInstance}
        setApiTokenInstance={setApiTokenInstance}
        friendNumber={friendNumber}
        setFriendNumber={setFriendNumber}
        setIsButtonClicked={setIsButtonClicked}
        isButtonClicked={isButtonClicked}></Form>}
    </>
  );
}

export default App;
